import { Fragment } from "react"
import { useState,useEffect } from "react";
import { useNavigate } from "react-router-dom";
import login from './api'
function Login(){
    const [login_data,set_login_data]=useState({
        account:'',
        password:''
    })
    const navigate=useNavigate()
    console.log(login_data)
    return(
        <Fragment>
            <div className="loginbox">
            <div className="login">
                <p style={{marginBottom:'8vh'}}>登入</p>
                <input value={login_data.account} onChange={(e)=>set_login_data({...login_data,account:e.target.value})} type="text" placeholder="請輸入帳號"/><br/>

                <input value={login_data.password} onChange={(e)=>set_login_data({...login_data,password:e.target.value})} type="password" placeholder="請輸入密碼"/><br/>
                <button onClick={()=>login(login_data)} style={{marginTop:'3vh'}} >登入</button>
            </div>
            </div>

        </Fragment>
    )
}
export default Login;
